import ButtonAppBar from "./ButtonAppBar";

import Box from '@mui/material/Box';
import { Typography, Button, Container } from "@mui/material";

const OrderApproved = () => {
    return (
        <Container>
            <ButtonAppBar />
            <Box
                sx={{
                    width: 300,
                    height: 300,
                    backgroundColor: 'rgba(255, 255, 255, 0.7)',
                    boxShadow: 'rgba(0, 0, 0, 0.24) 0px 3px 8px;',
                    borderRadius: '20px',
                    margin: 'auto',
                    marginTop: '20px'
                }}>
                <Typography variant="h5" sx={{ backgroundColor: '#E5FFF3', textAlign: 'center', fontWeight: 'bold' }}>Beställning godkänd!</Typography>
                <Typography variant='h6' sx={{ textAlign: 'center', mt: '5px', padding: '5px' }}>Du kan nu hämta ut ditt paket</Typography>
                <Typography sx={{ textAlign: 'center' }}>Hämta och lämna på: <br />
                    Granitvägen 15, 131 40 Nacka
                </Typography>
                <Button sx={{ color: 'black', backgroundColor: '#C1BBEB', margin: 'auto' }}>OK</Button>
            </Box>
        </Container>
    );
}

export default OrderApproved;
